import React from "react";
import Layout from "../components/MyLayout.js"

export default class browsersTest extends React.Component {
	state = {
		// names: [],
		// times: [],
		people: [],
	}

	async componentDidMount() {
		const url = "http://35.194.72.130/api/list";
		const response = await fetch(url);
		const data = await response.json();
		console.log(data.times.length);

		var newData = "";
		this.setState({
			people: ["hi"]
		})

		for (var i=1; i<data.times.length; i++) {
			newData = data.times[i].name + " " + data.times[i].time;
			newData = newData.split('\n').map(str => <p>{str}</p>);
			this.setState(previousState => ({
				people: [...previousState.people, newData[i].props.children]
			}));
		}


	}

	render() {
		return (
			<Layout>
				<div>
					{this.state.people}
				</div>
			</Layout>
		)
	}
}
